window.bookSummaryJSON = "<p>Entrepreneur Jesse Itzler chronicles his month of living and extreme fitness training with a Navy SEAL in the <i>New York Times </i>and number one<i> LA Times</i> best seller <i>Living With a Seal</i>, now with two bonus sections.</p> <p>Entrepreneur Jesse Itzler will try almost anything. His life is about being bold and risky. So when Jesse felt himself drifting on autopilot, he hired a rather unconventional trainer to live with him for a month-an accomplished Navy SEAL widely considered to be \"the toughest man on the planet\"!</p> <p><i>Living With a Seal</i> is like a buddy movie if it starred the Fresh Prince of Bel- Air...and Rambo. Jesse is about as easy-going as you can get. SEAL is...not. Jesse and SEAL's escapades soon produce a great friendship, and Jesse gains much more than muscle. At turns hilarious and inspiring, <i>Living With a Seal</i> ultimately shows you the benefits of stepping out of your comfort zone.</p>"; 
